  false,\n\t\"url\": null,\n\t\"notes\": \"California Current Ecosystem moorings (CCE1
  and CCE2) are surface buoys equipped with interdisciplinary scientific sensors including
  NOAA PMEL pCO2 system, meteorological sensors (wind, air temperature, air humidity,
  and air pressure), CTDs (temperature and conductivity), Acoustic Doppler Current
  Profiler (ADCP, ocean current), oxygen sensor, pH sensor, SUNA (nitrate+nitrite),
  and FLNTUS (fluorescence). CCE1 is located offshore in the core of the California
  Current (CalCOFI station 80.80), and CCE2 is closer to shore on the shelf break
  that is influenced by strong costal upwelling process (CalCOFI station 80.55). CCE
  moorings measure physical, biological, and chemical variables with temporal resolutions
  high enough to resolve event-scale phenomena and transmit real-time data to shore.
  These data are viewed on the website, http://mooring.ucsd.edu/cce and updated every
  6 hours. Annual cruises are conducted to recover and redeploy CCE1 (in fall) and
  CCE2 (in spring) moorings. During the cruises, CTD-Rosette casts are performed with
  collecting water samples of temperature, salinity, oxygen, DIC, alkalinity, NO2,
  NO3, Silicate, PO4, NH4, chlorophyll-a, and phaeo pigment.\",\n\t\"owner_org\":
